(23, 'Los Angeles Downtown', '<p><span style=\"font-size:16px\"><strong>Los Angeles: Go City Explorer Pass</strong></span></p>\r\n\r\n<p>Explorer pass for multiple entries. Each pass is valid for 60 days. (R) means advanced registration is necessary.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Price:</p>\r\n\r\n<ul>\r\n	<li>2 Activities: 336 USD for 4 (Approx 2688&nbsp;HKD)</li>\r\n	<li>3 Activities: 416 USD for 4 (Approx 3328&nbsp;HKD)</li>\r\n	<li>4 Activities: 496 USD for 4 (Approx 3968 HKD)</li>\r\n	<li>5 Activities: 548&nbsp;USD for 4 (Approx 4384HKD)</li>\r\n</ul>\r\n\r\n<p>Choice of Attractions (Underline = Suggested):</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Popular Attractions<strong> </strong></p>\r\n\r\n	<ul>\r\n		<li>\r\n		<p><u>Big Bus LA 1-day Classic Ticket</u></p>\r\n		</li>\r\n		<li>\r\n		<p><u>Warner Bros. Studio Tour (R)</u></p>\r\n		</li>\r\n		<li>\r\n		<p>Madame Tussauds Hollywood</p>\r\n		</li>\r\n		<li>\r\n		<p>Big Bus Celebrity Lifestyle and Homes Tour</p>\r\n		</li>\r\n		<li>\r\n		<p>Hollywood Sign Tour (R)</p>\r\n		</li>\r\n		<li>\r\n		<p>TCL Chinese Theatre - Tour or Movie and a drink</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p>Tours and Cruises</p>\r\n\r\n	<ul>\r\n		<li>\r\n		<p>Dolby Theatre Guided Tour - Home of the Academy Awards (R)</p>\r\n		</li>\r\n		<li>\r\n		<p>Celebrity Bike Tour (Guided or Self-Guided) by Bikes &amp; Hikes LA (R)</p>\r\n		</li>\r\n		<li>\r\n		<p>Haunted Hollywood Walking Tour (R)</p>\r\n		</li>\r\n		<li>\r\n		<p>Downtown LA Food and Culture Tour (R)</p>\r\n		</li>\r\n		<li>\r\n		<p>Perry&#39;s Beach Caf&eacute; and Rentals - Mountain Bike or Roller-Skates (All Day)</p>\r\n		</li>\r\n		<li>\r\n		<p><u>Whale Watch (Long Beach) (R)</u></p>\r\n		</li>\r\n		<li>\r\n		<p>Whale Watch (San Pedro) (R)</p>\r\n		</li>\r\n		<li>\r\n		<p><u>Harbor Cruise (Long Beach) </u></p>\r\n		</li>\r\n		<li>\r\n		<p>Harbor Cruise (San Pedro)</p>\r\n		</li>\r\n		<li>\r\n		<p>SoFi Stadium Tour (R)</p>\r\n		</li>\r\n		<li>\r\n		<p><u>Night Star Tour (R) </u></p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p>Museums and Landmarks</p>\r\n\r\n	<ul>\r\n		<li>\r\n		<p>California Science Center IMAX Movie</p>\r\n		</li>\r\n		<li>\r\n		<p><u>Aquarium of the Pacific (R)</u></p>\r\n		</li>\r\n		<li>\r\n		<p>La Brea Tar Pits and Museum</p>\r\n		</li>\r\n		<li>\r\n		<p>Grammy Museum (R)</p>\r\n		</li>\r\n		<li>\r\n		<p><u>Battleship IOWA Museum </u></p>\r\n		</li>\r\n		<li>\r\n		<p>LA Zoo</p>\r\n		</li>\r\n		<li>\r\n		<p>Natural History Museum of Los Angeles</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p>Leisure and Entertainment</p>\r\n\r\n	<ul>\r\n		<li>\r\n		<p>Yoga on the Beach - Huntington Beach (R)</p>\r\n		</li>\r\n		<li>\r\n		<p>$30 Credit at Sixty Four &amp; Hope</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>More Info:&nbsp;https://gocity.com/los-angeles/en-us/products/explorer</p>\r\n\r\n<hr />\r\n<hr />\r\n<hr />\r\n<hr />\r\n<p><span style=\"font-size:16px\"><strong>Schedule and Choices of Activity</strong></span></p>\r\n\r\n<p><u><strong>Day 0 (19 May)</strong></u></p>\r\n\r\n<p>Arrive at Los Angeles Airport at around 21:50;</p>\r\n\r\n<p>Depart to hotel: Choice of Hotel</p>\r\n\r\n<p>Rest.</p>\r\n\r\n<hr />\r\n<p><u><strong>Day 1 (20 May):</strong></u></p>\r\n\r\n<p>Breakfast at or near the hotel;</p>\r\n\r\n<p>Travel to Long Beach by Metro A line [Around 1.5 hour];</p>\r\n\r\n<p>Choice of activities:</p>\r\n\r\n<ul>\r\n	<li>Wale Watching and Dolphin&nbsp;Tour departing from Long Beach&nbsp;[Included in the Explorer Pass]\r\n	<ul>\r\n		<li>Duration: Approx 2 hours</li>\r\n		<li>Original Price: 180 USD for 4 (Approx 1450 HKD)</li>\r\n		<li>Start time:&nbsp;12:00 pm or 3:00 pm</li>\r\n		<li>Details:&nbsp;Get out on the water and see whales, dolphins, and other marine life up close, right off the coast of California. New Harbor Breeze cruise vessels feature an environmentally friendly design with ultra-quiet, low emission engines that leave whales and their marine environment undisturbed and luxury stadium seating offers exceptional viewing from every seat on board.</li>\r\n		<li><span style=\"color:#999999\">More Info: https://2seewhales.com/?utm_source=google&amp;utm_medium=cpc&amp;utm_term=Long%20beach%20whale%20watching&amp;utm_campaign={Campaign}&amp;utm_adgroup={AdGroup}&amp;utm_content={AdGroup}&amp;gclid=Cj0KCQiA6LyfBhC3ARIsAG4gkF-O_yOckdmbQPgx3jHUPqlkaw7Z2iOWx45Z-9QL9EQGIUwEdm7ELJkaAtOVEALw_wcB</span></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><span style=\"color:#999999\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230218103358-11676687638.png\" style=\"height:238px; width:600px\" /></span></p>\r\n\r\n<ul>\r\n	<li>Harbor Cruise (Long Beach)&nbsp;[Included in the Explorer Pass]\r\n	<ul>\r\n		<li>Duration: Approx 45 minutes</li>\r\n		<li>Original Price: 66 USD for 4 (Approx 528&nbsp;HKD)</li>\r\n		<li>Time Available: 11:30 - 18:15 (Multiple times available)</li>\r\n		<li>More info:&nbsp;https://www.aquariumofpacific.org/exhibits.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"https://tickets.harbor-cruises.com/UPLImage/kris.JPG\" style=\"height:329px; width:600px\" /></p>\r\n\r\n<ul>\r\n	<li>Aquarium of the Pacific&nbsp;[Included in the Explorer Pass]\r\n	<ul>\r\n		<li>Duration: 2-4 hours</li>\r\n		<li>Original Price: 147.8 USD for 4 (Approx 1200 HKD)</li>\r\n		<li>Opening hours: 09:00am - 06:00 pm</li>\r\n		<li>Details:&nbsp;Take a journey of discovery at the Aquarium of the Pacific in Long Beach. Discover sunny Southern California and Baja, the frigid waters of the Northern Pacific, and the colorful reefs of the Tropical Pacific. Please note: Reservations are required for this activity (please check your included digital guide for instructions).</li>\r\n		<li>More info:&nbsp;https://www.aquariumofpacific.org/exhibits.<img alt=\"LA: Aquarium of the Pacific Skip-the-Line Entry\" src=\"https://cdn.getyourguide.com/img/tour/e9bfbb384da85d12.jpeg/97.jpg\" style=\"height:310px; width:600px\" /></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Enjoy the sunset and dinner near Shoreline Park / Alamitos beach;</p>\r\n\r\n<p>Return to hotel by Metro A line [Approx 1.5 hours].</p>\r\n\r\n<hr />\r\n<p><u><strong>Day 2 (21 May)</strong></u></p>\r\n\r\n<p>Breakfast at or near the hotel;</p>\r\n\r\n<p>Travel to Wagner Bros Studio</p>\r\n\r\n<p>Recommended Activities:</p>\r\n\r\n<ul>\r\n	<li>Griffth Park Observatory + Hollywood Sign +/- Hike\r\n	<ul>\r\n		<li>Duration: 1-3+&nbsp;hours</li>\r\n		<li>Price\r\n		<ul>\r\n			<li>Entry fee: Nil</li>\r\n			<li>Tickets for SHOW: 40 USD for 4 (Approx 320 HKD)</li>\r\n		</ul>\r\n		</li>\r\n		<li>Opening hours of the Observatory: 10:00 am-10:00 pm</li>\r\n		<li>Transportation:&nbsp;DASH Observatory/Los Feliz bus from the&nbsp;Vermont/Sunset Station [10:00 am -&nbsp;10:00 pm]</li>\r\n		<li>Details:&nbsp;Griffith Observatory features space-related exhibits, and star shows in the planetarium and often hosts special events. A lot of people also go to the Observatory not to see the heavenly stars but to take in the panoramic city views.<img alt=\"Hike the Hollywood Hills, see the stars in sweats\" src=\"https://media-cldnry.s-nbcnews.com/image/upload/t_fit-1500w,f_auto,q_auto:best/ap/travel%20trip%20hollywood%20hills%20hiking--2005295152_v2.jpg\" style=\"height:369px; width:600px\" /></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;​​​​&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\"Griffith Observatory - Southern California\'s gateway to the cosmos!\" src=\"https://griffithobservatory.org/wp-content/uploads/2021/03/cameron-venti-c5GkEd-j5vI-unsplash_noCautionTape-1600x1186.jpg\" style=\"height:445px; width:600px\" />&nbsp;&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Walk of Fame\r\n	<ul>\r\n		<li>Duration: 1-2 hours</li>\r\n		<li>Price: Nil</li>\r\n		<li>Transportation: Hollywood/Highland Station</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230218122535-61676694336.png\" style=\"height:696px; width:600px\" />​​​​​​​</p>\r\n\r\n<ul>\r\n	<li>Venice Beach and Boardwalk + Santa Monica Pier\r\n	<ul>\r\n		<li>Duration: 1-2 hours +</li>\r\n		<li>Price\r\n		<ul>\r\n			<li>Venice Beach and Broadwalk: Nil</li>\r\n			<li>Santa Monica Pier: Refers to the photo below</li>\r\n		</ul>\r\n		</li>\r\n		<li>Opening hours:\r\n		<ul>\r\n			<li>Venice Beach and Broadwalk:&nbsp;</li>\r\n			<li>Santa Monica Pier: 11:00 am - 10:00 pm</li>\r\n		</ul>\r\n		</li>\r\n		<li>Transportation\r\n		<ul>\r\n			<li>From walk of fame: Bus No. 4</li>\r\n			<li>From Downtown: Metro Downtown Santa Monica Station</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230218120636-51676693196.png\" style=\"height:844px; width:517px\" /></p>\r\n\r\n<p>Other Activities:</p>\r\n\r\n<ul>\r\n	<li>1-Day Hop-on Hop-off Big Bus Los Angeles&nbsp;[Included in the Explorer Pass]\r\n	<ul>\r\n		<li>Duration: Variable</li>\r\n		<li>Original Price: 208 USD for 4 (Approx 1664 HKD)</li>\r\n		<li>Opening Hours\r\n		<ul>\r\n			<li>Hollywood Loop:&nbsp; Every 30-45 min between 10:00 am - 4:30 pm</li>\r\n			<li>Beach Loop: Depeart at Stop 6: 10:45 am, 11:45 am, 01:00 pm, 02:00 pm, 03:15 pm</li>\r\n		</ul>\r\n		</li>\r\n		<li>Important Landmark\r\n		<ul>\r\n			<li>Walk of Fame</li>\r\n			<li>Santa Monica Pier</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;​​​​​​​&nbsp;&nbsp;&nbsp;&nbsp;​​​​​​​&nbsp;&nbsp;&nbsp;&nbsp;​​​​​​​&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230218113824-31676691504.png\" style=\"height:347px; width:600px\" />&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;​​​​​​​&nbsp;&nbsp;&nbsp;&nbsp;​​​​​​​&nbsp;&nbsp;&nbsp;&nbsp;​​​​​​​&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230218113854-41676691533.png\" style=\"height:378px; width:600px\" /></p>\r\n\r\n<ul>\r\n	<li>Wagner Bros Studio tour&nbsp;[Included in the Explorer Pass]\r\n	<ul>\r\n		<li>Duration: Approx 3&nbsp;hours</li>\r\n		<li>Original Price: 280 USD for 4 (Approx 22400 HKD)</li>\r\n		<li>Start time: Every 30 minutes between 09:00 am - 03:30 pm</li>\r\n		<li>Transportation\r\n		<ul>\r\n			<li>Metro + Bus (Around 1.5 hour ride)</li>\r\n			<li>Uber (Approx 20-30 USD, or Approx 160-240 HKD)</li>\r\n		</ul>\r\n		</li>\r\n		<li>Details:&nbsp;Explore where Hollywood is made. Go behind the lens and discover the secrets of movie-making magic. This studio tour brings you closer than ever to the entertainment you love. Explore one of the busiest working studios in Los Angeles with an expert tour guide.</li>\r\n		<li>More info:&nbsp;https://www.aquariumofpacific.org/exhibits.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230218111025-21676689825.png\" style=\"height:408px; width:600px\" /></li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/110.0.0.0 Safari/537.36', '5', '1', '2023-02-18 12:25:56', '2023-02-18 12:26:15', ''),
