(29, '2023舊金山交通', '<p><span style=\"font-size:18px\"><strong><a href=\"https://www.viviantrip.com/san-francisco-transportation/\">交通簡介</a></strong></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><strong><a href=\"https://www.klook.com/zh-HK/airport-transfers/results/?flightDirection=1&amp;from=%E4%B8%89%E8%97%A9%E5%B8%82%E5%9C%8B%E9%9A%9B%E6%A9%9F%E5%A0%B4%20(SFO)&amp;to=Hotel%20Riu%20Plaza%20Fisherman%C2%B4s%20Wharf&amp;code=SFO&amp;long=-122.375&amp;lat=37.61899948&amp;poi_lat=37.8074145&amp;poi_long=-122.4134809&amp;poiId=50049141&amp;place=&amp;time=2023-05-10%2013%3A30&amp;pas=3&amp;address=2500%20Mason%20St%2C%20San%20Francisco%2C%20CA%2094133%2C%20USA\">Klook book車</a></strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/110.0.0.0 Safari/537.36', '2', '1', '2023-02-28 10:20:59', '2023-03-19 15:05:08', ''),
(28, '13/5 -14/5酒店資訊', '<p><strong>San Francisco Airport Marriott Waterfront (<a href=\"https://upgradedpoints.com/travel/hotels/san-francisco-airport-marriott-waterfront-in-depth-review/\">文章</a>)</strong></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"SFO Marriott Shuttle Schedule\" src=\"https://upgradedpoints.com/wp-content/uploads/2022/03/20220302_142036-732x549.jpg\" /></p>\r\n\r\n<p><span style=\"font-size:20px\"><strong>❗️❗️❗️You&rsquo;ll never have to wait long for an airport shuttle from either the airport or the hotel. The&nbsp;service runs <u>24/7 every 15 minutes throughout the day </u>and <u>every 30 minutes from 12:30 a.m. to 4:30 a.m</u>.❗️❗️❗️</strong></span></p>\r\n\r\n<p><u><strong>Final price<br />\r\n(taxes included)<br />\r\nUS$201.98</strong></u></p>\r\n', 'Mozilla/5.0 (Linux; Android 10; SM-N9750) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/110.0.0.0 Mobile Safari/537.36', '2', '1', '2023-02-24 20:34:04', '2023-03-20 11:05:44', ''),
