(31, 'Snow King Resort資訊(14/5-15/5)', '<p><span style=\"font-size:18px\"><strong>網上預約Snow king Resort 機場接駁巴士(<a href=\"https://calendly.com/snowkingresortshuttle?utm_source=website&amp;utm_medium=snow-king&amp;utm_campaign=shuttle&amp;_ga-ft=1a2MjG.0.0.0.0.1X221Hc-1PuCuXN.0.1\">連結</a>)<br />\r\n(入住14日前)(一定要book)</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:12pt\"><strong><span style=\"font-size:15.0pt\">自助早餐：6:30am - 11:00am(每個人19美金)</span></strong><br />\r\n<strong><span style=\"font-size:15.0pt\"><strong>Buffet breakfast available for a fee daily 6:30 AM&ndash;11:00 AM: USD 19 for adults and USD 10 for children</strong></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><strong><a href=\"https://www.snowking.com/dining\">官網&nbsp;</a>&nbsp; &nbsp;<a href=\"https://www.expedia.com.hk/en/Jackson-Hole-Hotels-Snow-King-Resort-Hotel-Luxury-Residences.h4372.Hotel-Information\">Expedia</a></strong></span></p>\r\n\r\n<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:12pt\"><strong><span style=\"font-size:15.0pt\"><img alt=\"\" src=\"https://rm1web.tk/upload_image/Screenshot_20230313-221427_Gmail1678716926.jpg\" style=\"height:1062px; width:1079px\" /></span></strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/110.0.0.0 Safari/537.36', '3', '1', '2023-03-06 11:26:21', '2023-04-06 10:18:07', ''),
