(36, '出發前須完成項目', '<ul>\r\n	<li><strong><u><span style=\"font-size:20px\">Book活動</span></u></strong>\r\n	<ul>\r\n		<li><strong><span style=\"font-size:16px\">租WiFi蛋</span><span style=\"font-size:15px\">(</span><a href=\"https://www.songwifi.com.hk/order/song-wifi?destination_id=42&amp;start_date=2023-05-10&amp;end_date=2023-05-26\">SONGWIFI</a>&nbsp;/&nbsp;<a href=\"https://www.wifibb.com/zh-HK/after/Area_selection#bookingwifi\">WIFIBB</a>&nbsp;/&nbsp;<a href=\"https://www.klook.com/zh-HK/activity/16363-4g-wifi-usa/?spm=City.ActivityList%3Aany%3A%3ACityActivitiesFilter%3ACard_LIST&amp;clickId=a53253e848\">Uroaming</a><span style=\"font-size:15px\">)</span></strong></li>\r\n		<li><strong><span style=\"font-size:16px\">網上預約Old Faithful Inn&nbsp;及 Lake Yellowstone Cottage&nbsp;晚餐</span><br />\r\n		<span style=\"font-size:15px\">(入住60日前)</span></strong></li>\r\n		<li><s><strong><span style=\"font-size:16px\">預約Jackson Hole單車行程</span><span style=\"font-size:15px\">(<a href=\"https://hoffsbikesmith.com/pages/rentals\">Hoff&#39;s Bikesmith</a>)</span></strong></s></li>\r\n		<li><strong><span style=\"font-size:16px\">網上預約Snow king Resort&nbsp;機場接駁巴士</span><span style=\"font-size:15px\">(<a href=\"https://calendly.com/snowkingresortshuttle/airport-shuttle-arrivals-clone?back=1&amp;month=2023-05&amp;date=2023-05-14\">連結</a>)</span><br />\r\n		<span style=\"font-size:15px\">(入住14日前)(一定要book)</span></strong></li>\r\n	</ul>\r\n	</li>\r\n	<li><strong><u><span style=\"font-size:20px\">下載APPS</span></u></strong>\r\n	<ul>\r\n		<li><strong><span style=\"font-size:16px\">Delta Airline (</span><a href=\"https://play.google.com/store/apps/details?id=com.delta.mobile.android&amp;hl=en_US&amp;pli=1\">Google Play</a>)&nbsp;(<a href=\"https://apps.apple.com/us/app/fly-delta/id388491656\">App Store</a>)<br />\r\n		<span style=\"font-size:15px\">(註冊👉萬一臨時轉冇娛樂系統嘅機型👉可以用App睇)<br />\r\n		(註冊👉國內航班可免費用機上WiFi)</span></strong></li>\r\n		<li><strong><span style=\"font-size:16px\">Uber&nbsp;及 Lyft</span>