(37, 'The Lexington At Jackson Hole', '<p><strong><span style=\"font-size:20px\">1/F：<a href=\"https://www.google.com.hk/maps/@43.483221,-110.7625608,3a,75y,95.75h,80.08t/data=!3m6!1e1!3m4!1sAF1QipMbnbdUrshhZgu3SkYOo_OY3F78czyLDd4_liuQ!2e10!7i13312!8i6656?hl=zh-HK\">酒店大堂實景</a></span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:20px\">2/F：<a href=\"https://www.google.com.hk/maps/@43.4828998,-110.7625771,3a,75y,294.75h,92.72t/data=!3m6!1e1!3m4!1sAF1QipP0zuPcdB2CHr5CFzbOi_tuWjjddhH5bzaDMlGb!2e10!7i13312!8i6656?hl=zh-HK\">泳池</a></span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:20px\">3/F：<a href=\"https://www.google.com.hk/maps/@43.4832399,-110.7626498,3a,90y,87.5h,82.24t/data=!3m6!1e1!3m4!1sAF1QipOrL9I9wYGSZCAfcy-gGonKgAZYuvBjY9T4KaZg!2e10!7i13312!8i6656?hl=zh-HK\">早餐</a>&nbsp;(好少種類)</span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:20px\">4/F：<a href=\"https://www.google.com.hk/maps/@43.4830992,-110.7627813,3a,75y,87.5h,82.24t/data=!3m6!1e1!3m4!1sAF1QipNPE2bK1MbwJ8jNDWbFTNPjs733r31b2jAlwfzH!2e10!7i13312!8i6656?hl=zh-HK\">房間</a></span></strong></p>\r\n', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/111.0.0.0 Safari/537.36', '3', '1', '2023-03-14 13:36:04', '2023-04-02 19:43:26', ''),
