(45, '迪士尼樂園地圖', '<p><strong><a href=\"https://www.dreamsunlimitedtravel.com/images/disneyland/disneyland-park-map-01.jpg\">Disneyland Park Map in California</a></strong></p>\r\n\r\n<p><img alt=\"Disneyland Resort Map\" src=\"https://www.dreamsunlimitedtravel.com/images/disneyland/disneyland-park-map-01.jpg\" style=\"height:276px; width:700px\" /></p>\r\n\r\n<p><a href=\"https://www.dreamsunlimitedtravel.com/images/disneyland/disney-california-adventure-park-map.jpg\">Disney California Adventure Map</a></p>\r\n\r\n<p><img src=\"https://www.dreamsunlimitedtravel.com/images/disneyland/disney-california-adventure-park-map.jpg\" style=\"height:318px; width:700px\" /></p>\r\n\r\n<p><img alt=\"圖片\" src=\"https://media.discordapp.net/attachments/1064144165509799996/1105052757393678388/disneyland-park-map.png?width=1080&amp;height=492\" /></p>\r\n', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/111.0.0.0 Safari/537.36', '6', '1', '2023-04-17 15:35:32', '2023-05-09 23:12:01', ''),
(46, '洛杉磯交通', '<p><strong><span style=\"font-size:20px\"><u>TAP CARD</u></span></strong></p>\r\n\r\n<ul>\r\n	<li><strong><span style=\"font-size:20px\">官網最新票價：<a href=\"https://www.metro.net/riding/fares/\">連結</a></span></strong></li>\r\n	<li><strong><span style=\"font-size:20px\">1-Day Pass：<span style=\"background-color:#f1c40f\">US$3.50</span></span></strong></li>\r\n	<li><strong><span style=\"font-size:20px\">7-Day Pass：<span style=\"background-color:#f1c40f\">US</span><span style=\"background-color:#f1c40f\">$12.50</span></span></strong></li>\r\n	<li><strong><span style=\"font-size:20px\">使用範圍：Metro Rail、Metro Bus</span></strong></li>\r\n</ul>\r\n\r\n<p><img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230421165013-11682067013.png\" style=\"height:365px; width:980px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"https://rm1web.tk/upload_image/image-20230421171034-21682068237.png\" style=\"height:734px; width:989px\" /></p>\r\n\r\n<p style=\"text-align:center\"><u><strong><span style=\"font-size:20px\">哪裡購買與充值TAP</span></strong></u></p>\r\n\r\n<p><img alt=\"\" src=\"https://www.viviantrip.com/wp-content/uploads/2019/11/Los-Angeles-TAP-Card-1.jpg\" style=\"height:100%; width:100%\" /></p>\r\n', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/112.0.0.0 Safari/537.36', '5', '1', '2023-04-21 16:50:42', '2023-04-21 17:39:24', ''),
(47, '19/5活動選擇', '<ol>\r\n	<li><strong><s><span style=\"font-size:20px\">&nbsp;<span style=\"color:#c0392b\">BANNED</span>乘坐驛馬車</span><span style=\"font-size:18px\">(Stagecoach Rides)</span></s><br />\r\n	<a href=\"https://www.jacksonholenet.com/entertainment/stagecoach_rides.php\">網址</a></strong>\r\n	<p><u><strong>Town Square Stagecoach Rides (Summer)</strong></u></p>\r\n\r\n	<p><strong>Open: Memorial Day to Labor Day<br />\r\n	Location: Wooden Shack on Town Square (Corner of Broadway and Cache)<br />\r\n	Length: 10 minutes around downtown<br />\r\n	Cost: $6-$10<br />\r\n	Seats 4-6 passengers.</strong></p>\r\n	</li>\r\n	<li>\r\n	<p>&nbsp;</p>\r\n	<strong><span style=\"font-size:20px\">Jackson Hole Historical Society &amp; Museum</span><br />\r\n	<a href=\"https://jacksonholehistory.org/\">網址</a><br />\r\n	Adults: $10.00&nbsp;<br />\r\n	Summer to Fall 2023 hours will be Tuesday &ndash; Saturday, 10 am &ndash; 5pm from May 9 &ndash; November 4, 2023.</strong>\r\n\r\n	<p>&nbsp;</p>\r\n	</li>\r\n</ol>\r\n', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/112.0.0.0 Safari/537.36', '3', '1', '2023-04-24 20:47:44', '2023-05-03 13:59:33', ''),
(48, 'LA Uber Info', '<p>Low Angeles Airport &mdash; Home2 Suite</p>\r\n\r\n<p><img alt=\"\" src=\"https://rm1web.tk/upload_image/C35134D5-B113-44A4-92C3-11361E5740AF1682600090.png\" style=\"height:100%; width:100%\" />Home2 suite &mdash; Loews hollywood</p>\r\n\r\n<p><img alt=\"\" src=\"https://rm1web.tk/upload_image/38192CA1-0BF8-4AEC-BAE5-29A475B35E4C1682600314.png\" style=\"height:100%; width:100%\" /></p>\r\n', 'Mozilla/5.0 (iPhone; CPU iPhone OS 15_4_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/15.4 Mobile/15E148 Safari/604.1', '6', '1', '2023-04-27 20:55:00', '2023-04-27 20:58:46', ''),
(51, 'Passowords', '<p style=\"text-align:center\"><strong><span style=\"font-size:18px\">一號房主人行李箱密碼:</span><span style=\"font-size:22px\"><u>383</u></span></strong></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18px\"><strong>肥媽行李箱密碼:</strong></span><strong><span style=\"font-size:22px\"><u>752</u></span></strong></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:18px\"><strong>肥爸行李箱密碼:</strong></span><u><strong><span style=\"font-size:22px\">690</span></strong></u></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Mozilla/5.0 (Linux; Android 10; K) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/112.0.0.0 Mobile Safari/537.36', '1', '1', '2023-05-09 23:11:17', '2023-05-09 23:11:36', '');
