(66, 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/110.0.0.0 Safari/537.36', '<p style=\"text-align:center\"><strong><span style=\"font-size:32px\">第1間酒店</span></strong><strong><a href=\"https://www.youtube.com/watch?v=OiVOyzPYPTI\"><span style=\"font-size:24px\">酒店其他設施影片</span></a>,<a href=\"https://www.youtube.com/watch?v=2uVWDVnAKIs&amp;t=7s\"><span style=\"font-size:24px\">房間配置影片</span></a></strong></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"1\" style=\"height:100%; width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"color:#e67e22\"><strong><span style=\"font-size:18px\">價格</span></strong></span></td>\r\n			<td>\r\n			<p><strong><span style=\"font-size:18px\">房價 HK$&nbsp;5,282+ HK$&nbsp;898 稅費及其他費用</span></strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#e67e22\"><strong><span style=\"font-size:18px\">床鋪</span></strong></span></td>\r\n			<td><strong><span style=\"font-size:18px\">1 張沙發床 &nbsp;和 2 張加大雙人床&nbsp;</span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#e67e22\"><strong><span style=\"font-size:18px\">客房面積</span></strong></span></td>\r\n			<td><strong><span style=\"font-size:18px\">28 平方公尺</span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#e67e22\"><strong><span style=\"font-size:18px\">早餐</span></strong></span></td>\r\n			<td><strong><span style=\"font-size:18px\">歐陸式早餐</span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#e67e22\"><strong><span style=\"font-size:18px\">彈性</span></strong></span></td>\r\n			<td><strong><span style=\"font-size:18px\">免費取消 2023 年 5 月 19 日 下午11:59 前<br />\r\n			無需訂金－到店付款</span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"color:#e67e22\"><strong><span style=\"font-size:18px\">步行至迪士尼時間</span></strong></span></td>\r\n			<td><strong><span style=\"font-size:18px\">9-11分鐘</span></strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:28px\"><strong>總結：<img class=\"autoimg emojis\" src=\"https://rm1web.tk/system/ckeditor/plugins/hkemoji/sticker/onion/Onion--112.gif\" style=\"height:50px; width:50px\" /><img class=\"autoimg emojis\" src=\"https://rm1web.tk/system/ckeditor/plugins/hkemoji/sticker/onion/Onion--112.gif\" style=\"height:50px; width:50px\" /><img class=\"autoimg emojis\" src=\"https://rm1web.tk/system/ckeditor/plugins/hkemoji/sticker/onion/Onion--112.gif\" style=\"height:50px; width:50px\" /></strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:28px\"><strong>優點：房面積正常，又有包早餐，價錢合理，有廚房(可以叮嘢食)</strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:28px\"><strong>缺點：要行比較遠</strong></span><img alt=\"Free daily buffet breakfast\" src=\"https://images.trvl-media.com/lodging/1000000/30000/21000/20967/26e4d9a2.jpg?impolicy=resizecrop&amp;rw=1200&amp;ra=fit\" /><img alt=\"Free daily buffet breakfast\" src=\"https://images.trvl-media.com/lodging/1000000/30000/21000/20967/1f72f6b4.jpg?impolicy=resizecrop&amp;rw=1200&amp;ra=fit\" /><img alt=\"Studio, 2 Queen Beds, Accessible, Bathtub | Premium bedding, individually furnished, desk, laptop workspace\" src=\"https://images.trvl-media.com/lodging/1000000/30000/21000/20967/2f50b9fb.jpg?impolicy=resizecrop&amp;rw=1200&amp;ra=fit\" /></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"住宿相片集\" src=\"https://cf.bstatic.com/xdata/images/hotel/max1024x768/298746370.jpg?k=66e02366fa3f394fc70250a455478a4680f2909dc176ce083aec844e6fec8c0c&amp;o=&amp;hp=1\" /></p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"Studio, 2 Queen Beds, Non Smoking | Premium bedding, individually furnished, desk, laptop workspace\" src=\"https://images.trvl-media.com/lodging/1000000/30000/21000/20967/w5761h3229x0y0-ce7126e1.jpg?impolicy=resizecrop&amp;rw=1200&amp;ra=fit\" /></p>\r\n\r\n<p><img alt=\"Coffee/tea maker\" src=\"https://images.trvl-media.c