(217, 'Mozilla/5.0 (iPhone; CPU iPhone OS 15_4_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/15.4 Mobile/15E148 Safari/604.1', '<p style=\"text-align:center\"><strong><img alt=\"\" src=\"https://www.cathaypacific.com/content/dam/content-fragment/zh_hk/config/logo.originalimage.svg\" style=\"float:left; height:30px; width:70px\" />&nbsp;</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>(<a href=\"https://www.cathaypacific.com/mb/#/zh_HK/login\">自助訂位管理服務</a>)</strong></p>\r\n\r\n<p><strong><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><u>HKG -&gt; SFO , LAX -&gt; HKG&nbsp;<br />\r\n(Booking Reference: 52ODFK)</u></span></span><br />\r\n(<a href=\"http://www.rm1web.tk/img/%E6%A9%9F%E7%A5%A8/CLC%20MR%2010MAY%20HKG.pdf\">收據【弟】</a>)(<a href=\"https://www.rm1web.tk/img/%E6%A9%9F%E7%A5%A8/CLP%20MR%2010MAY%20HKG.pdf\">收據【爸】</a>)(<a href=\"https://www.rm1web.tk/img/%E6%A9%9F%E7%A5%A8/WY%2010MAY%20HKG.pdf\">收據【媽】</a>)</strong></p>\r\n\r\n<p><strong>HKG -&gt; SFO (CX870)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">去程起飛時間</span></span>：5月10日 13:55(香港時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">去程降落時間</span></span>：5月10日 11:25(美國時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">去程機型</span></span>：A350-900<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">去程座位</span></span>：45A,45B,45C</strong></p>\r\n\r\n<p><strong>LAX -&gt; HKG (CX881)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程起飛時間</span></span>：5月25日 00:30(美國時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程降落時間</span></span>：5月26日 06:45(香港時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程機型</span></span>：B777-300ER<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程座位</span></span>：45H,45J,45K</strong></p>\r\n\r\n<hr />\r\n<p><strong><img alt=\"\" src=\"https://content.delta.com/content/www/apac/en.damAssetRender.20211110T1419424440500.html/content/dam/delta_homepage_redesign/Logo/Delta-Logo.svg\" style=\"height:15px; width:95px\" /><br />\r\n(<a href=\"https://zt.delta.com/my-trips/search\">尋找您的行程</a>)</strong></p>\r\n\r\n<p><strong><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><u>SFO -&gt; SLC -&gt; JAC, JAC -&gt; SLC -&gt; LAX<br />\r\n(Ticket Number: <a href=\"tel:0062362159893\">0062362159893</a>)</u></span></span><br />\r\n(<a href=\"https://www.rm1web.tk/img/%E6%A9%9F%E7%A5%A8/itinerary.pdf\">收據</a>)</strong></p>\r\n\r\n<p><strong>SFO-&gt; SLC (DL 2356)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">起飛時間</span></span>：5月14日 06:05(美國時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">降落時間</span></span>：5月14日 08:55(美國時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">機型</span></span>：A220-300<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">座位</span></span>：21C,21D,21E</strong></p>\r\n\r\n<p><strong>SLC-&gt; JAC (DL 2278)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程起飛時間</span></span>：5月14日 11:20(美國時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程降落時間</span></span>：5月14日 12:22(美國時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程機型</span></span>：A319<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程座位</span></span>：22A,22B,22C</strong></p>\r\n\r\n<p><strong>JAC-&gt; SLC (DL 2837)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程起飛時間</span></span>：5月19日 18:10(美國時間)<br />\r\n<span style=\"color:#000000\"><span style=\"background-color:#e67e22\">回程降落時間</span></span>：5月19日 19:12(美國時間)<br />\r\n<span style=\"color